import { Redirect } from "react-router-dom";

const PostGame = ({ token, userData, setUserData, win }) => {

    if (!token) {
        return <Redirect to='/' />
    }

    let results = 0
    if (win === true) {
        results = 1
    }

    return (
        <>
            { win? 
                <h3>
                    Congratulations {userData.username}, you won!
                </h3>
            :
                <h3>
                    You got caught!
                </h3>
            }


        </>
    );
}

export default PostGame;
